int
StasDeadTime_set( dot11SSIDConfigTable_rowreq_ctx *rowreq_ctx, u_long StasDeadTime_val )
{

    DEBUGMSGTL(("verbose:dot11SSIDConfigTable:StasDeadTime_set","called\n"));

    /** should never get a NULL pointer */
    netsnmp_assert(NULL != rowreq_ctx);

    /*
     * TODO:461:M: |-> Set StasDeadTime value.
     * set StasDeadTime value in rowreq_ctx->data
     */

	int rc = MFD_ERROR;
	if(rowreq_ctx->data.BindSecurityID == 0)
	{
		return MFD_ERROR;
	}
	if(RS_NOTINSERVICE == rowreq_ctx->data.SSIDRowStatus && rowreq_ctx->data.is_modify) /*modify*/
	{
		void *connection = NULL;
	    if(SNMPD_DBUS_ERROR == get_instance_dbus_connection(rowreq_ctx->data.parameter, &connection, SNMPD_INSTANCE_MASTER_V3))
	        return MFD_ERROR;

		int ret1 = 0,ret2 = 0,ret3 = 0,ret4 = 0,ret5 = 0;					 
		DCLI_WLAN_API_GROUP *WLANINFO = NULL;
		char value[10] = { 0 };
		ret1 = show_wlan_one(rowreq_ctx->data.parameter, connection, rowreq_ctx->data.wlanLocalID, &WLANINFO);
		if(1 == ret1)
		{
			if((WLANINFO->WLAN[0]->Status) != 1)/*wlan is enable*/
			{
				ret2 = config_wlan_service(rowreq_ctx->data.parameter, connection, rowreq_ctx->data.wlanLocalID, "disable");
				if(1 != ret2)
				{
					if(SNMPD_CONNECTION_ERROR == ret2)
					{
						close_slot_dbus_connection(rowreq_ctx->data.parameter.slot_id);
					}
					Free_one_wlan_head(WLANINFO);
					return MFD_ERROR;
				}
			}

			memset(value, 0, sizeof(value));
			snprintf(value, sizeof(value)-1, "%d", (StasDeadTime_val/100));
			ret3 = set_ap_max_detect_interval_cmd(rowreq_ctx->data.parameter, connection, rowreq_ctx->data.BindSecurityID, value);
			if(ret3 == 1)
			{
				rowreq_ctx->data.StasDeadTime = StasDeadTime_val;
				rc = MFD_SUCCESS;
			}
			else
			{
				if(SNMPD_CONNECTION_ERROR == ret3) 
				{
					close_slot_dbus_connection(rowreq_ctx->data.parameter.slot_id);
				}
				rc = MFD_ERROR;
			}

			ret5 = apply_wlanID(rowreq_ctx->data.parameter, connection, rowreq_ctx->data.BindSecurityID, rowreq_ctx->data.wlanLocalID); 
			snmp_log(LOG_DEBUG, "StasDeadTime_set: apply_wlanID: ret5 = %d\n", ret5);
			if(1 != ret5)
			{
				if(SNMPD_CONNECTION_ERROR == ret5)
				{
					close_slot_dbus_connection(rowreq_ctx->data.parameter.slot_id);
				}
				Free_one_wlan_head(WLANINFO);
				return MFD_ERROR;
			}

			if((WLANINFO->WLAN[0]->Status) != 1)/*wlan is enable*/
			{
				ret4 = config_wlan_service(rowreq_ctx->data.parameter, connection, rowreq_ctx->data.wlanLocalID, "enable");
				if(1 != ret4)
				{
					if(SNMPD_CONNECTION_ERROR == ret4)
					{
						close_slot_dbus_connection(rowreq_ctx->data.parameter.slot_id);
					}
					Free_one_wlan_head(WLANINFO);
					return MFD_ERROR;
				}
			}
			Free_one_wlan_head(WLANINFO);
		}
		else
		{
			if(SNMPD_CONNECTION_ERROR == ret1)
			{
				close_slot_dbus_connection(rowreq_ctx->data.parameter.slot_id);
			}
			return MFD_ERROR;
		}
	}
	else if(RS_NOTREADY == rowreq_ctx->data.SSIDRowStatus)/*creat and wait*/
	{
		rowreq_ctx->data.StasDeadTime = StasDeadTime_val;
		rc = MFD_SUCCESS;
	}
    return rc;
	
    rowreq_ctx->data.StasDeadTime = StasDeadTime_val;

    return MFD_SUCCESS;
} /* StasDeadTime_set */

